def main():
    # Read input
    x, a = [int(i) for i in input().split()]

    # Compare the two values and print the result
    if x < a:
        print(0)
    else:
        print(10)

if __name__ == '__main__':
    main()


def main():
    # Read input and convert to int.
    x, a = [int(i) for i in input().split()] 

    # Compare the two values and print the result.
    if x < a:
        print(0)
    else:
        print(10)

if __name__ == '__main__':
    main()


